import React from "react";
import ".././output.css";
import HeaderText from "../componets/headertext";
function Aboutme(props) {
  return (
    <div className=" w-[42vw] h-[86vh] ml-[5vw] mt-[8.5vh] border border-white grid grid-rows-[3fr_1fr_3fr_1fr_4fr] ">
      <div className="border border-white">
        <HeaderText
          w="36.32vw"
          h="7.79vh"
          textsize="4.43vw"
          position="left"
          line1="SOFTWARE"
          line2="ENGINEER"
          lastColor="#914bf1"
        />
      </div>
      <div className="border border-white"></div>
      <div className="border border-white"></div>
      <div className="border border-white"></div>
    </div>
  );
}

export default Aboutme;
